e.exports='---changelog---\ndate: "2021-10-04"\nlocale: "en-US"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNew Features {added marginTop}\n======================\n\n* **Upload a different avatar for every server.** With Nitro, be who you want and use a different avatar in each of your servers. Set a unique avatar in each of your servers. Be a student in one, your D&D character in another, and your true self in a third, whoever that may be... \n* **Boosts needed for Boosting Levels 2 and 3 lowered.** Servers can now reach Level 2 with 7 Boosts and Level 3 with 14 Boosts! Unlock things for your server like more custom emoji, higher upload limits for everyone, a server banner, arguments about what the server banner should be, and role icons.\n* **And oh yea added custom role icons to Boosting Level 2.** If you have a server with 7 Boosts, upload an image or choose a default or custom emoji to set as an icon for each role. Role icons will display next to role names in the member’s list and next to usernames while text chatting. Head to Server Settings > Roles and edit a role to get started. \n* **Student Hubs are rolling out internationally.** Connect with student-run servers for clubs, study groups, and more for your school or university. To access your Student Hub, grab your school email and [get started](https://discord.com/invite/hzA3MtAURu). Or, if you’d like to go for a walk, open Discord, make a right and head to Server Discovery, and then take two lefts past the convenience store and click on the new Student Hubs tab.\n* **New threads permissions added.** Added a *Send Messages in Threads* permission to improve your community’s experience and updated *Create Public Threads*, *Create Private Threads*, and *Manage Threads* permissions to be easier to understand. Learn more in our [Threads Moderation FAQ](https://support.discord.com/hc/en-us/articles/4404809613847).\n\n\nAccessibility Updates {progress}\n======================\n\n* **Added keyboard support for drag and drop.** Now you can sort and organize everything including server collections, channels, and roles all via your keyboard. \n* ** New text-to-speech (TTS) slider.** Customize how fast messages are read aloud to you using the new TTS slider. Learn more [here](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "de"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNeue Funktionen {added marginTop}\n======================\n\n* **Lade verschiedene Avatare für jeden Server hoch.** Sei, wer du sein willst, mit Nitro und verwende verschiedene Avatare auf allen deiner Server. Verwende einen einzigartigen Avatar auf allen deiner Server. Sei ein Schüler oder Student auf einem, dei dein D&D-Charakter auf einem anderen und dein wahres Selbst auf einem dritten, wer auch immer das sein mag... \n* **Die Anzahl der Boosts für die Boosting-Level 2 und 3 wurden verringert.** Server können jetzt mit 7 Boosts Level 2 und mit 14 Boosts Level 3 erreichen!Schalte neue Sachen für deinen Server frei, wie z. B. mehr personalisierte Emojis, höhere Upload-Limits für alle, einen Server-Banner, Diskussionen darüber, was das Server-Banner sein sollte, und Rollen-Icons.\n* **Oh ja, und personalisierte Rollen-Icons wurden zum Boosting-Level 2 hinzugefügt.** Wenn du einen Server mit 7 Boosts hast, lade ein Bild hoch oder verwende ein personalisiertes Emoji, um es als Icon für eine Rolle zu verwenden. Rollen-Icons werden neben dem Rollennamen in der Mitgliederliste und neben den Benutzernamen im Text-Chat angezeigt. Gehe in die Servereinstellungen > Rollen und bearbeite eine Rolle, um loszulegen.\n* **Bildungshubs sind jetzt international verfügbar** Verbinde dich mit von Schülern erstellten Servern für AGs, Lerngruppen und mehr für deine Schule oder Universität. Um auf dein Bildungshub zugreifen zu können, schnapp dir deine Schul-E-Mail-Adresse und [lege los](https://discord.com/invite/hzA3MtAURu). Oder, falls du einen Umweg gehen willst, öffne Discord, biege rechts ab und gehe zur Serverentdeckung und biege dann zweimal nach dem Mini-Markt links ab und klicke auf den neuen Bildungshub-Tab.\n* **Neue Threads-Berechtigung hinzugefügt** Wir haben eine *Nachrichten in Threads senden*-Berechtigung hinzugefügt, um das Erlebnis deiner Community zu verbessern und wir haben die *Öffentliche Threads erstellen*, *Private Threads erstellen* und *Threads verwalten* Berechtigungen aktualisiert, damit diese einfacher zu verstehen sind. Erfahre mehr darüber in unserem [Threads Moderation FAQ](https://support.discord.com/hc/en-us/articles/4404809613847).\n\n\nUpdates für die Zugänglichkeit {progress}\n======================\n\n* **Tastaturunterstützung für Drag-and-Drop hinzugefügt.** Du kannst jetzt alles, inklusive Serversammlungen, Kanäle und Rollen, über deine Tastatur sortieren und organisieren. \n* **Neuer Regler für Text-zu-Sprache (TTS) hinzugefügt.** Stelle mit dem neuen TTS-Regler ein, wie schnell dir Nachrichten vorgelesen werden sollen. Erfahre mehr [hier](https://support.discord.com/hc/en-us/articles/1500010454681).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "da"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNye Funktioner {added marginTop}\n======================\n\n* **Upload forskellige avatarer for hver server.** Med Nitro, vær den du ønsker at være og brug en anden avatar på hver af dine servere. Indstil en unik avatar på hver af dine servere. Vær studerende i en, din D&D-karakter i en anden og dit sande jeg i en tredje, hvem end dette må være... \n* **Antal af Boosts nødvendige for Boosting Niveau 2 og 3 sænket.** Servere kan nu nå niveau 2 med 7 boosts og niveau 3 med 14 boosts! Lås ting op for din server som flere brugertilpassede emoji, højere uploadgrænser for alle, et serverbanner, argumenter omkring hvad serverbanneret skal være, og rolleikoner.\n* **Og når ja tilføjet tilpassede rolleikoner til Boosting Niveau 2. ** Hvis du har en server med 7 Boosts, så kan du uploade et billede eller vælge en brugertilpassede emoji, der kan anvendes som et ikon for hver rolle. Rolleikoner vises ved siden af ​​rollenavne på medlemslisten og ved siden af ​​brugernavne, mens du chatter tekst. Gå til Serverindstillinger > Roller, og rediger en rolle for at komme i gang.\n* **Student Hubs ruller ud internationalt.** Opret forbindelse til elevdrevne servere til klubber, studiegrupper og mere til din skole eller universitet. For at få adgang til din Student Hub, få fat på din skolemail og [kom i gang](https://discord.com/invite/hzA3MtAURu). Eller hvis du gerne vil gå en tur, så skal du åbne Discord, dreje til højre og gå til Server Discovery og derefter dreje til venstre to gange forbi dagligvarebutikken og klikke på den nye fane Student Hubs.\n* **Nye tråde tilladelser tilføjet.** Tilføjede *Send beskeder i tråde* tilladelse til at forbedre dit fællesskabs oplevelse og opdateret *Opret offentlige tråde*, *Opret private tråde*, og *Administrer tråde* tilladelser for at være lettere at forstå. Lær mere i vores [Ofte stillede spørgsmål om moderering af tråde](https://support.discord.com/hc/da/articles/4404809613847).\n\n\nTilgængelighedsopdateringer {progress}\n======================\n\n* **Tilføjet tastatur understøttelse til træk og slip. ** Nu kan du sortere og organisere alt inklusiv serversamlinger, kanaler og roller via dit tastatur.\n* **Ny tryk-og-tal (TTS) slider.** Tilpas, hvor hurtigt beskeder læses højt for dig ved hjælp af den nye TTS-slider. Lær mere [her](https://support.discord.com/hc/en-us/articles/1500010454681)\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "es-ES"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNuevas funciones {added marginTop}\n======================\n\n* **Sube avatares diferentes para cada servidor.** Con Nitro, sé quien quieras ser y usa un avatar diferente en cada uno de tus servidores. Establece un avatar único en cada uno de tus servidores. Sé un estudiante en uno, tu personaje de D&D en otro, y tu verdadero yo en un tercero, quienquiera que sea... \n* **Se redujo el número de Boosts necesarios para los niveles 2 y 3.** ¡Los servidores ahora pueden alcanzar el nivel 2 con 7 Boosts y el nivel 3 con 14 Boosts! Desbloquea cosas para tu servidor como más emojis personalizados, límites de carga más altos para todos, un cartel del servidor, discusiones sobre qué debería ser el cartel del servidor e íconos de rol.\n* **Ah, sí, agregamos íconos de rol personalizados al nivel 2 de mejoras.** Si tienes un servidor con 7 Boosts, sube una imagen o elige un emoji personalizado para configurarlo como un ícono para cada rol. Los íconos de rol se mostrarán junto a los nombres del rol en la lista de miembros y junto a los nombres de usuario en el chat de texto. Dirígete a Ajustes del servidor > Roles y edita un rol para comenzar. \n* **Los Centros de estudiantes se están implementando internacionalmente.** Conéctate con servidores administrados por estudiantes como clubes para tu escuela o universidad, grupos de estudio y más. Para acceder a tu Centro de estudiantes, toma el correo electrónico de tu escuela y [comienza](https://discord.com/invite/hzA3MtAURu). O, si deseas dar un paseo, abre Discord, gira a la derecha y diríjete a Explora servidores públicos, y luego gira dos veces a la izquierda, después de la tiendita de la esquina y haz clic en la nueva pestaña Centros de estudiantes.\n* **Se agregaron nuevos permisos para hilos.** Agregamos el permiso *Enviar mensajes en los hilos* para mejorar la experiencia de tu comunidad, y actualizamos los permisos *Crear hilos públicos*, *Crear hilos privados*, y *Gestionar hilos* para que sean más fáciles de entender. Obtén más información en nuestro [FAQ de Moderación en hilos](https://support.discord.com/hc/es/articles/4404809613847).\n\n\nActualizaciones de accesibilidad {progress}\n======================\n\n* **Se agregó compatibilidad con el teclado para arrastrar y soltar.** Ahora puedes ordenar y organizar todo, incluyendo las colecciones de servidores, los canales y los roles, todo a través de tu teclado. \n* **Nuevo control deslizante de Texto a voz (TTS).** Personaliza la rapidez con la que se le leen los mensajes en voz alta con el nuevo control deslizante TTS. Obtén más información [aquí](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "fr"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNouvelles Fonctionnalités {added marginTop}\n======================\n\n\n* **Téléchargez des avatars différents pour chaque serveur.** Avec Nitro, soyez qui vous voulez et utilisez un avatar différent sur chacun de vos serveurs. Définissez un avatar unique dans chacun de vos serveurs. Soyez un étudiant sur l\'un, votre personnage de D&D sur l\'autre, et votre véritable personnalité sur un troisième, qui que ce soit... \n* **Boosts nécessaires pour les niveaux de boost 2 et 3 revus à la baisse.** Les serveurs peuvent désormais atteindre le niveau 2 avec 7 boosts et le niveau 3 avec 14 boosts ! Débloquez des choses pour votre serveur comme plus d\'emojis personnalisés, des limites de téléchargement plus élevées pour tout le monde, une bannière de serveur, des discussions sur ce que la bannière du serveur devrait être, et des icônes pour chaque rôle.\n* ** Ah oui, et on a ajouté des icônes de rôle personnalisées au niveau de boost 2.** Si vous avez un serveur avec 7 Boosts, téléchargez une image ou choisissez un emoji personnalisé à définir comme icône pour chaque rôle. Les icônes de rôle s\'afficheront à côté des noms de rôle dans la liste des membres et à côté des noms d\'utilisateur lors des discussions textuelles. Allez dans Paramètres du serveur > Rôles et modifiez un rôle pour commencer. \n* *** Les Pôles étudiants sont déployés au niveau international.**Connectez vous avec des serveurs gérés par des étudiants pour des clubs, des groupes d\'étude, et plus encore pour votre école ou université. Pour accéder à votre Pôle Etudiant, récupérez l\'e-mail de votre école et [démarrez] (https://discord.com/invite/hzA3MtAURu). Ou, si vous voulez vous promener, ouvrez Discord, prenez à droite et dirigez-vous vers Server Discovery, puis prenez deux fois à gauche après la supérette et cliquez sur le nouvel onglet Pôles Etudiant.\n* **Nouvelles permissions pour les fils de discussion ajoutées. ** La permission *Envoyer des messages dans les fils de discussion* a été ajoutée pour améliorer l\'expérience de votre communauté et les permissions *Créer des fils de discussion publics*, *Créer des fils de discussion privés* et *Gérer les fils de discussion* ont été mises à jour pour être plus faciles à comprendre. Pour en savoir plus, consultez notre [FAQ sur la modération des fils de discussion](https://support.discord.com/hc/fr/articles/4404809613847).\n\nMises à jour de l\'Accessibilité {progress}\n======================\n\n* **Ajout de la prise en charge du clavier pour le glisser-déposer.** Vous pouvez désormais tout trier et organiser, y compris les collections de serveurs, les salons et les rôles, à l\'aide de votre clavier. \n* **Nouveau curseur de synthèse vocale (TTS) ** Personnalisez la vitesse de lecture des messages à haute voix à l\'aide du nouveau curseur TTS. En savoir plus [ici](https://support.discord.com/hc/fr/articles/1500010454681).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "it"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNuove Funzioni {added marginTop}\n======================\n\n* **Carica un avatar diverso per ogni server.** Con Nitro, puoi essere chi vuoi e utilizzare un avatar diverso in ciascuno dei tuoi server. Imposta un avatar unico per ogni server. Sii uno studente in uno, il tuo personaggio di D&D in un altro e il tuo vero io in un terzo, chiunque esso sia...\n* **I potenziamenti necessari per raggiungere i livelli 2 e 3 sono stati ridotti.** Ora i server potranno raggiungere il livello 2 con 7 potenziamenti e il livello 3 con 14 potenziamenti! Sblocca nuove cose per il tuo server come più emoji personalizzate, limiti di caricamento più elevati per tutti, un banner del server, discussioni riguardo a come dovrebbe essere il banner del server e le icone dei ruoli.\n* **E oh sì, abbiamo anche aggiunto delle icone di ruolo personalizzate per il livello 2 di Boosting.** Se hai un server con 7 Boost, potrai caricare un\'immagine o scegliere un\'emoji personalizzata da impostare come icona per ogni ruolo. Le icone dei ruoli verranno visualizzate accanto ai nomi dei ruoli nell\'elenco dei membri e accanto ai nomi utente durante la chat di testo. Vai su Impostazioni Server > Ruoli e modifica un ruolo per iniziare.\n* **Gli Student Hub si stanno diffondendo a livello internazionale.** Connettiti con server gestiti da studenti per club, gruppi di studio e altro per la tua scuola o università. Per accedere al tuo Student Hub, utilizza l\'e-mail della tua scuola e [comincia così](https://discord.com/invite/hzA3MtAURu). Oppure, se desideri fare una passeggiata, apri Discord, svolta a destra e vai su Server Discovery, quindi svolta due volte a sinistra oltre il minimarket e fai clic sulla nuova scheda Student Hub.\n* **Aggiunti nuovi permessi per i thread.** È stata aggiunta l\'autorizzazione *Invia messaggi nelle discussioni* per migliorare l\'esperienza della tua community e sono state aggiornate le autorizzazioni *Crea discussioni pubbliche*, *Crea discussioni private* e *Gestisci discussioni* per essere più facili da capire. Scopri di più nelle nostre [Domande frequenti sulla moderazione dei thread](https://support.discord.com/hc/en-us/articles/4404809613847).\n\n\nAggiornamenti sull\'Accessibilità {progress}\n======================\n\n* **Aggiunto il supporto della tastiera per il trascinamento della selezione.** Ora puoi ordinare e organizzare tutto, incluse raccolte di server, canali e ruoli, tramite la tastiera.\n* **Nuovo dispositivo di scorrimento per la sintesi vocale (TTS).** Personalizza la velocità di lettura dei messaggi ad alta voce utilizzando il nuovo dispositivo di scorrimento TTS. Ulteriori informazioni [qui](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "ja"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\n新機能 {added marginTop}\n======================\n\n* **各サーバーに別のアバターをアップロードしよう**Nitroがあれば、各サーバーで違うアバターを使ってなりたい人になれるから、好きなアバターをセットしよう。こっちでは学生、あっちではD&Dのキャラ、そしてここでは本当の自分を、なんて風にね。\n* **レベル2と3に必要なブースト数が減ったよ** ブーストx7でレベル2に、ブーストx14でレベル3に！カスタム絵文字や全員が恩恵を受けるアップロード上限の緩和、サーバーバナー、そしてロールアイコンをアンロックしよう。サーバーバナーがなにがいいか、みんなでわいわい議論してね。\n* **ああそうだ、カスタムロールアイコンはレベル2で使えるにしたんだ** サーバーがブーストx7されていれば、画像をアップロードするか、デフォルトorカスタム絵文字を選択して、各ロールにセットすることができるようになったんだった。ロールアイコンはメンバーリストのロールネームの隣に表示されて、テキストチャット中はユーザーネームの隣にも表示されるよ。サーバー設定＞ロールから編集してね。\n* **学生ハブを世界に公開** クラブとか勉強とか、学校や大学のために学生が運営しているサーバーに繋がろう。学生ハブにアクセスするには、学校のEメールを使って[始めてみよう](https://discord.com/invite/hzA3MtAURu)。あるいは、外に出てDiscordを開いて、右に曲がってサーバーディスカバリーが見えたら、そこから学生ハブをクリックして。\n* **スレッドに新権限を追加** ”スレッドでメッセージを送信”を追加したんだ。これでコミュニティの体験を改善できると思う。あと、”公開スレッドを作成”、”プライベートスレッドの作成”、そして”スレッドの管理”もアップデートしたよ。こっちのほうが分かりやすいでしょ。詳細はこっち [Threads Moderation FAQ](https://support.discord.com/hc/en-us/articles/4404809613847).\n\n\nアクセシビリティアップデート {progress}\n======================\n\n* **ドラッグアンドドロップのためのキーボードサポートを追加** キーボードだけでサーバーコレクション、チャンネル、ロールを含むすべてを管理できるゾ。\n* **新テキスト-トゥ-スピーチ（TTS)スライダーを追加** メッセージの読み上げ速度を、新TTSスライダーで調整できるようになった。詳細は [こっち](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "ko"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\n새로운 기능 {added marginTop}\n======================\n\n* **서버마다 다른 아바타를 업로드해 보세요.** Nitro를 사용하면 각 서버에서 다른 아바타를 사용하고 원하는 사람이 될 수 있습니다. 각 서버에 고유한 아바타를 설정해 보세요. 하나는 학생이 되고, 다른 하나는 D&D 캐릭터가 되고, 다른 하나는 자신의 진정한 자아가 되어보세요.\n* **부스트 레벨 2 및 3에 필요한 부스트 수가 낮아졌습니다.** 이제 서버는 부스트 7개로 레벨 2, 부스트 14개로 레벨 3에 도달할 수 있습니다! 더 많은 커스텀 이모티콘, 모든 사람에 대해 상향된 업로드 제한, 서버 배너, 역할 아이콘을 잠금 해제하고 서버 배너를 어떻게 디자인 할지 논의해 보세요.\n* **그리고 부스팅 레벨 2에 커스텀 역할 아이콘이 추가되었습니다.** 7개의 부스트가 있는 서버라면, 이미지를 업로드하거나 기본 또는 커스텀 이모티콘을 선택해 각 역할에 대한 아이콘으로 설정할 수 있습니다. 역할 아이콘은 멤버 목록의 역할 이름 옆과 문자 채팅 시 사용자 이름 옆에 표시됩니다. 사용을 시작하려면 서버 설정 > 역할로 이동해 역할을 편집해 보세요.\n* **학생 허브는 국제적으로 출시되고 있습니다.** 학교 또는 대학의 클럽, 스터디 그룹 등을 위해 학생이 운영하는 서버에 연결해 보세요. 학생 허브에 액세스하려면 학교 이메일을 받아 [시작](https://discord.com/invite/hzA3MtAURu)하세요. 또는 산책을 하고 싶다면 Discord를 열고 우회전하여 서버 살펴보기로 이동한 다음 편의점을 지나 좌회전하여 새로운 학생 허브 탭을 클릭하세요.\n* **새 스레드 권한이 추가되었습니다.** 커뮤니티의 경험을 개선하기 위해 *스레드에서 메시지 보내기* 권한이 추가되었고 이해하기 쉽도록 *공개 스레드 만들기*, *비공개 스레드 만들기* 및 *스레드 관리하기* 권한이 업데이트되었습니다. [Threads Moderation FAQ](https://support.discord.com/hc/en-us/articles/4404809613847)에서 자세히 알아보세요.\n\n\n접근성 업데이트 {progress}\n======================\n\n* **드래그 앤 드롭에 대한 키보드 지원이 추가되었습니다.** 이제 키보드를 사용해 서버 컬렉션, 채널 및 역할을 포함한 모든 것을 정렬하고 구성할 수 있습니다.\n* **새로운 텍스트 음성 변환(TTS) 슬라이더.** 새로운 TTS 슬라이더를 사용하여 메시지를 소리내어 읽는 속도를 사용자 커스텀합니다. [여기](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab)에서 자세히 알아보세요.\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "nl"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNieuwe functies {added marginTop}\n======================\n\n* **Upload voor iedere server een andere avatar.** Met Nitro kun je zijn wie je wilt zijn en voor elke server een andere avatar gebruiken. Stel een unieke avatar in voor iedere server waar je onderdeel van bent. Wees in de ene server een student, een D&D-personage in een andere, en je ware zelf in een derde server, wie dat ook mag zijn... \n* **Aantal vereiste Boosts voor Level 2 en 3 zijn verlaagd.** Servers kunnen nu Level 2 bereiken met 7 Boosts en Level 3 met 14 Boosts! Ontgrendel extra\'s voor de server zoals meer aangepaste emojis, hogere uploadlimieten voor iedereen, een server banner, onenigheid over hoe de server banner eruit moet zien, en rol-iconen.\n* **Oh ja, rol-iconen zijn toegevoegd aan Boost Level 2.** Als je een server hebt met 7 Boosts, upload een afbeelding of stel een standaard of aangepaste emoji in als icoon voor iedere rol. Rol-iconen zullen weergegeven worden naast de titel van de rol in de ledenlijst en naast de gebruikersnamen tijdens tekstchat. Ga naar Serverinstellingen > Rollen en wijzig een rol om aan de slag te gaan. \n* **Student Hubs zijn wereldwijd beschikbaar.** Maak verbinding met servers die beheerd worden door studenten voor clubs, studiegroepen, en meer voor je school of universiteit. Om toegang te krijgen tot je Student Hub, ga je met je e-mailadres voor school [aan de slag](https://discord.com/invite/hzA3MtAURu). Of, als je graag een ommetje maakt, open je Discord, sla je rechts en ga je naar Servers Verkennen, en vervolgens ga je twee keer naar links voorbij de buurtwinkel en klik je op het nieuwe tabblad Student Hubs.\n* **Nieuwe threads machtigingen toegevoegd.** Nieuwe *Verstuur berichten in Threads* machtiging toegevoegd om de ervaring van je community te verbeteren en *Creëer Openbare Threads*, *Creëer Privé Threads*, en *Beheer Threads* machtigingen zijn geüpdatet zodat ze makkelijker te begrijpen zijn. Leer meer in onze [Veelgestelde vragen over het beheren van Threads](https://support.discord.com/hc/nl/articles/4404809613847-Threads-Moderation-FAQ).\n\n\nToegankelijkheid Updates {progress}\n======================\n\n* **Keyboardondersteuning voor slepen en loslaten toegevoegd.** Nu kun je alles sorteren en ordenen met je keyboard zoals je serververzameling, kanalen, en rollen. \n* **Nieuwe tekst-naar-spraak (text-to-speech,TTS) slider.** Pas de voorleessnelheid aan met de nieuwe TTS slider. Ga voor meer informatie naar [dit artikel](https://support.discord.com/hc/nl/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "pl"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNowości {added marginTop}\n======================\n\n* **Wgrywaj inny awatar dla każdego serwera.** Dzięki Nitro możesz być, kim chcesz i korzystać z innego awatara na każdym z Twoich serwerów. Niech wszędzie będzie unikatowy. Bądź studentem na jednym serwerze, postacią z D&D na innym, a sobą na kolejnym, jakkolwiek się widzisz... \n* **Wymagana liczba wzmocnień na poziomy 2 i 3 została obniżona.** Serwery mogą od teraz osiągnąć 2 poziom za pomocą 7 wzmocnień, a 3 za pomocą 14 wzmocnień! Dzięki temu odblokujesz dla swojego serwera takie rzeczy jak więcej własnych emoji, większy limit wgrywanych danych dla wszystkich, baner serwera, dyskusje na temat wyglądu banera i ikony dla ról.\n* **A właśnie, dodatkowe ikony ról dla 2 poziomu wzmocnienia.** Jeśli Twój serwer posiada 7 wzmocnień, możesz wgrać obraz lub wybrać własną emoji jako ikonę dla każdej roli. Ikony ról pojawią się obok nazw ról na liście członków oraz obok nazw członków podczas rozmów. Przejdź do Ustawień serwera > Role i zacznij zmieniać ich ustawienia. \n* **Centra studenckie są dostępne dla wszystkich.** Połącz się z serwerami studenckimi, skupiającymi się na klubach, grupach naukowych i nie tylko w Twojej szkole lub uniwersytecie. Aby uzyskać dostęp do centrum studenckiego, skopiuj adres email swojej szkoły i [zacznij tutaj](https://discord.com/invite/hzA3MtAURu). Albo jeśli masz ochotę na spacer, otwórz Discorda, skręć w prawo i przejdź do wyszukiwarki serwerów, potem dwa razy w lewo, miniesz spożywczak i trafisz na nową zakładkę z centrami studenckimi.\n* **Nowe uprawnienia wątków.** Dodaliśmy uprawnienie do *Wysyłania wiadomości w wątkach*, aby społeczności lepiej się z nich korzystało i zaktualizowaliśmy uprawnienia do *Tworzenia wątków publicznych*, *Tworzenia prywatnych wątków* oraz *Zarządzania wątkami*, aby łatwiej było je zrozumieć. Więcej informacji znajdziecie w naszym [FAQ do moderacji wątków](https://support.discord.com/hc/en-us/articles/4404809613847).\n\n\nUsprawnienia dostępności {progress}\n======================\n\n* **Dodaliśmy klawiaturowe wsparcie dla funkcji przeciągnij i upuść.** Od teraz z poziomu klawiatury można dokonać pełnego sortowania lub organizacji wszystkiego, od kolekcji serwerów, przez kanały, po role. \n* **Nowy suwak zamiany tekstu na mowę (TTS)** Ustaw, jak szybko czytane są wiadomości za pomocą nowego suwaka TTS. Więcej informacji znajduje się [tutaj](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "pt-BR"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNovos Recursos {added marginTop}\n======================\n\n* **Use um avatar diferente em cada servidor.** Com o Nitro, seja que você quiser e use um avatar diferente em cada um dos servidores em que participa. Seja o/a estudante em um servidor, mas também seja seu personagem do D&D em outro, e mostre seu verdadeiro eu num terceiro servidor, seja lá o que for...\n* **Redução no número de Impulsos necessários para os Níveis de Impulso 2 e 3.** Os Servidores agora podem alcançar o Nível 2 com 7 Impulsos e 3 com 14! Ative novas funcionalidades ao seu servidor como mais emojis personalizados, limite maior de upload para todos, banners de servidor, discussões sobre qual deve ser o banner, e ícones para os Cargos.\n* **Ah, verdade! Tem isso também: adicionamos ícones customizados para os cargos no Nível de Impulso 2.** Se você tem um servidor com 7 impulsos ou mais, você poderá carregar uma imagem ou escolher um emoji customizado para ser o ícone de um cargo. Esses ícones vão aparecer ao lado do nome do cargo na lista de membros e ao lado dos nomes dos usuários nos chats de texto. Vá em Configurações de Servidor > Cargos e edite um cargo para começar.\n* **As Centrais de Estudantes estão sendo lançadas internacionalmente.** Conecte-se a servidores administrados por alunos focados em clubes, grupos de estudo e muito mais para sua escola ou universidade. Para acessar a Central de Estudantes, pegue seu e-mail estudantil [começar](https://discord.com/invite/hzA3MtAURu). Ou, se quiser dar um confere, abra o Discord, pegue a direita, chegando em Descoberta de Servidores, dali são duas vezes à esquerda depois da loja da mercado e clique na aba Centrais de Estudantes.\n* **Novas permissões para as Conversas.** Adicionamos a permissão *Enviar Mensagens em Conversas* para melhorar a experiência da comunidade e incrementamos as já existentes *Criar Conversas Públicas*, *Criar Conversas Privadas*, and *Gerenciar Conversas* para ficaremos mais fáceis de entender. Você poderá ler mais sobre isso no nosso [FAQ de Moderação das Conversas](https://support.discord.com/hc/articles/4404809613847).\n\n\nAtualizações de Acessibilidade {progress}\n======================\n\n* **Suporte para arrastar e soltar adicionado aos teclados.** Agora você pode dividir e organizar tudo, incluindo coleções de servidores, canais e cargos, tudo por meio de seu teclado. \n* **Novo controle para o pressionar-para-falar (text-to-speech (TTS)).** Controle a rapidez com que as mensagens são lidas em voz alta para você usando o novo controle deslizante. Veja mais [aqui](https://support.discord.com/hc/articles/1500010454681).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "ru"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nНовые функции {added marginTop}\n======================\n\n* **Загружайте разные аватары на разных серверах.** С Nitro будьте тем, кем хотите быть, используйте разные аватары на каждом из ваших серверов. Установите уникальный аватар на каждом сервере. Будьте студентом на одном, своим персонажем из D&D на другом, и самим собой на третьем, кто бы это ни был...\n* **Количество бустов, необходимых для 2-го и 3-го уровня бустинга, снизилось.** Для 2-го уровня теперь нужно 7 бустов, а для 3-го - 14! Разблокируйте для вашего сервера такие штуки, как большее количество кастомных эмодзи, более высокий лимит загрузки для всех, баннер сервера и иконки для ролей.\n* **И да, добавлены иконки для ролей доступные со втором уровнем бустинга.** Если на вашем сервере есть 7 бустов, вы можете загрузить картинку или выбрать эмодзи в качестве иконки для каждой роли. Иконки ролей будут отображаться рядом с названиями ролей в списке участников и рядом с именами пользователей в текстовом чате. Перейдите в "Настройки сервера" > "Роли" > кликните на роль, чтобы установить иконку.\n* **Студенческие центры постепенно появляются на международном уровне.** Подключайтесь к управляемым студентами серверам для клубов по интересам, учебных групп и многого другого в вашей школе или университете. Чтобы получить [здесь](https://discord.com/invite/hzA3MtAURu) доступ к Студенческому центру, вам понадобится ваш электронный адрес от школы/университета. Либо, откройте Discord, нажмите кнопку слева внизу "Исследуйте публичные серверы" > новая вкладка "Студенческие центры".\n* **Добавлены новые права для веток.** Добавлено для удобства право *Отправлять сообщения в ветках*, а также обновлены права *Создать публичные ветки*, *Создание приватных веток*, *Управление ветками*. Узнайте больше в нашем [ЧАВО по веткам](https://support.discord.com/hc/articles/4404809613847).\n\n\nОбновления специальных возможностей {progress}\n======================\n\n* **Добавлена ​​поддержка клавиатуры для перетаскивания.** Теперь вы можете сортировать и упорядочивать всё, включая коллекции серверов, каналы и роли, с помощью клавиатуры.\n* **Новый слайдер преобразования текста в речь (TTS).** Настройте скорость чтения сообщений вслух с помощью нового слайдера TTS. Узнайте больше [здесь](https://support.discord.com/hc/articles/1500010454681).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "sv-SE"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nNya funktioner {added marginTop}\n======================\n\n* **Ladda upp olika avatarer på varje server.** Med Nitro kan du vara vem du vill och använda olika avatarer på var och en av dina servrar. Ställ in unik avatar på varje enskild server. Var student på en, din D&D-karaktär på en annan och ditt riktiga jag på en tredje, vem det nu kan vara …\n* **Boostar som krävs för Boostnivå 2 och 3 har sänkts.**\nNu kan servrar nå nivå 2 med 7 boostar och nivå 3 med 14 boostar! Lås upp saker på din server, till exempel anpassade emojis, högre uppladdningsgränser för alla, en serverbanner, diskussioner om vad den bästa serverbannern kan vara, samt rollikoner.\n* **Åh, just ja, anpassade rollikoner har lagts till i boostnivå 2.** Om du har en server med 7 boostar kan du ladda upp en bild eller välja en anpassad eller standardemoji och ange den som ikon för önskad roll. Rollikoner visas bredvid rollens namn i medlemslistan och bredvid användarnamnet i textchattar. Gå till Serverinställningar > Roller och redigera en roll för att komma igång.\n* **Studenthubbar släpps internationellt.** Anslut till studentstyrda servrar för klubbar, studiegrupper och mer på dina skola eller ditt universitet. För att få tillgång till din Studenthubb tar du din skole-postadress för att [komma igång](https://discord.com/invite/hzA3MtAURu). Om du vill ta omvägen öppnar du Discord, svänger höger och går till Upptäck offentliga servrar, svänger vänster två gånger förbi närbutiken och klickar på den nya fliken Studenthubbar.\n* **Nya behörigheter för Trådar har lagts till.** Behörigheten *Skicka meddelanden i Trådar* har lagts till för att förbättra din communitys upplevelse. Dessutom har behörigheterna *Skapa allmänna Trådar*, *Skapa privata Trådar* och *Hantera Trådar* uppdaterats för att bli mer lättförståeliga. Lä mer i våra [Vanliga frågor om Trådmoderering](https://support.discord.com/hc/en-us/articles/4404809613847).\n\n\nTillgänglighetsuppdateringar (förlopp)\n======================\n\n* **Tangentbordsstöd för dra och släpp har lagts till.** Nu kan du sortera och organisera allt inklusive serversamlingar, kanaler och roller, allt via ditt tangentbord.\n* **Nytt reglage för text-till-tal (TTS).** Anpassa hur snabbt meddelanden läses upp när genom att använda det nya TTS-reglaget. Läs mer [här](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "zh-TW"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\n新功能 {added marginTop}\n======================\n\n* **為每個伺服器上傳不同的頭像** 只要您正在訂閱Nitro，就能在每一個伺服器，成為不同的自己。您可以為每個伺服器設定不同頭像。比如，在某個伺服器上是學生，但在另一個伺服器上使用D&D頭像，在第三個伺服器上使用真實照片，然後在另一個伺服器上可能又使用不同頭像... \n* **伺服器升為等級2-3所需的數量調降** 即日起，伺服器上只要有7個加成就能升為等級2，有14個加成就能晉升為等級3囉！伺服器解鎖後將能獲得自定義表情符號，更高的上傳檔案限制，伺服器橫幅，針對伺服器橫幅該如何設計的抱怨，以及身份組圖示。\n* **喔對了，只要伺服器達到等級2，就能自定義身份組圖示** 如果您手上任何伺服器已獲得7個加成，就可以為身份組選擇一個表情符號，或是上傳專屬頭像。身份組圖示將會出現在成員列表內的身份組名稱旁，並且在聊天時顯示在成員名字旁邊。您到「伺服器設定」＞「身份組」開始設定吧！\n* **學生中心功能已經正式全球推出** 連接所有學生們運作的伺服器，將學校，大學中的社團，學習小組通通連在一起。如果您需要訪問您的學校中心，請使用學校專用的郵件按 [參加](https://discord.com/invite/hzA3MtAURu)。或是，如果您想散散步的話，也可以打開Discord，進入「探索公開伺服器」，路過轉角的便利商店後，看到「學生中心」按一下即可。\n* **新的討論串權限** 我們新增了 *在討論串傳送訊息* 權限以便改善社群體驗，並且更新了 *建立公開討論串* , *建立私人討論串*，以及 *管理討論串* 等權限，讓權限內容更淺顯易懂。您可以藉由閱讀 [管理討論串問與答](https://support.discord.com/hc/en-us/articles/4404809613847) 一文進一步了解。\n\n\n輔助功能更新 {progress}\n======================\n\n* **新增鍵盤上的拖放輔助功能** 現在只要鍵盤在手，您就能簡單管理所有的伺服器，頻道，以及身份組，或為他們分類。 \n* **新的文字朗讀 (TTS) 調整器** 您可以使用新的文字朗讀調整器，依喜好調整文字朗讀的速度。您可以從 [此連結](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab) 進一步了解文字朗讀功能。\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "zh-CN"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\n新功能 {added marginTop}\n======================\n\n* **为每个服务器上传不同的头像** 只要您正在订阅Nitro，就能在每一个服务器，成为不同的自己。您可以为每个服务器设定不同头像。比如，在某个服务器上是学生，但在另一个服务器上使用D&D头像，在第三个服务器上使用真实照片，然后在另一个服务器上可能又使用不同头像...\n* **服务器升为等级2-3所需助力数量调降** 即日起，服务器上只要有7个助力就能升为等级2，有14个助力就能晋升为等级3啰！服务器解锁后将能获得自定义表情符号，更高的上传档案限制，服务器横幅，针对服务器横幅该如何设计的牢骚，以及身份组图标。\n* **喔对了，只要服务器达到等级2，就能自定义身份组图标** 如果您手上任何服务器已获得7个助力，就可以为身份组选择一个表情符号，或是上传专属头像。身份组图标将会出现在成员列表内的身份组名称旁，并且在聊天时显示在成员名字旁边。您到「服务器设定」＞「身份组」开始设定吧！\n* **学生中心功能已经正式全球推出** 连接所有学生们运作的服务器，将学校，大学中的社团，学习小组通通连在一起。如果您需要访问您的学校中心，请使用学校专用的邮件按 [参加](https://discord.com/invite/hzA3MtAURu)。或是，如果您想散散步的话，也可以打开Discord，进入「探索公开服务器」，路过转角的便利店后，看到「学生中心」按一下即可。\n* **新的讨论串权限** 我们新增了 *在讨论串传送讯息* 权限以便改善社群体验，并且更新了 *建立公开讨论串* , *建立私人讨论串*，以及 *管理讨论串* 等权限，让权限内容更浅显易懂。您可以藉由阅读 [管理讨论串问与答](https://support.discord.com/hc/en-us/articles/4404809613847) 一文进一步了解。 \n\n\n辅助功能更新 {progress}\n======================\n\n* **新增键盘上的拖放辅助功能** 现在只要键盘在手，您就能简单管理所有的服务器，频道，以及身份组，或为他们分类。\n* **新的文字朗读 (TTS) 调整器** 您可以使用新的文字朗读调整器，依喜好调整文字朗读的速度。您可以从 [此连结](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab) 进一步了解文字朗读功能。\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "th"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nคุณลักษณะใหม่ {added marginTop}\n======================\n\n* **อัปโหลดรูปสัญลักษณ์ประจำตัวที่แตกต่างกันสำหรับทุกเซิร์ฟเวอร์** ด้วย Nitro เป็นตัวคุณเองตามต้องการและใช้รูปสัญลักษณ์ประจำตัวที่แตกต่างกันในแต่ละเซิร์ฟเวอร์ของคุณ ตั้งค่ารูปสัญลักษณ์ประจำตัวที่ไม่ซ้ำกันในแต่ละเซิร์ฟเวอร์ของคุณ เป็นนักเรียนอันนึง ตัวละคร D&D อีกอันนึง และอันที่สามเป็นตัวตนที่แท้จริงของคุณเอง ไม่ว่าจะเป็นใครก็ตาม...\n* **บูสต์ที่จำเป็นสำหรับการบูสต์ระดับ 2 และ 3 ที่ต่ำลง** ตอนนี้เซิร์ฟเวอร์สามารถเข้าถึงระดับ 2 ได้ด้วย 7 บูสต์ และระดับ 3 ด้วย 14 บูสต์! ปลดล็อกสิ่งต่าง ๆ สำหรับเซิร์ฟเวอร์ของคุณ เช่น อีโมจิที่กำหนดเอง ขีดจำกัดการอัปโหลดที่สูงขึ้นสำหรับทุกคน แบนเนอร์เซิร์ฟเวอร์ ข้อโต้แย้งเกี่ยวกับแบนเนอร์ของเซิร์ฟเวอร์ และไอคอนบทบาท\n* **และใช่ เพิ่มไอคอนบทบาทที่กำหนดเองในการบูสต์ระดับ 2** หากคุณมีเซิร์ฟเวอร์ที่มี 7 บูสต์ ให้อัปโหลดภาพหรือเลือกอีโมจิที่กำหนดเองเพื่อตั้งเป็นไอคอนสำหรับแต่ละบทบาท ไอคอนบทบาทจะแสดงถัดจากชื่อบทบาทในรายชื่อสมาชิกและถัดจากชื่อผู้ใช้ขณะแชทด้วยข้อความ ไปที่การตั้งค่าเซิร์ฟเวอร์ > บทบาท และแก้ไขบทบาทเพื่อเริ่มต้น\n* **Student Hubs กำลังเปิดตัวในระดับสากล** เชื่อมต่อกับเซิร์ฟเวอร์ที่ดำเนินการโดยนักเรียนสำหรับสโมสร กลุ่มการศึกษา และอื่น ๆ สำหรับโรงเรียนหรือมหาวิทยาลัยของคุณ หากต้องการเข้าถึง Student Hub ให้เลือกใช้อีเมลของโรงเรียนและ [เริ่มต้นใช้งาน](https://discord.com/invite/hzA3MtAURu) หรือถ้าคุณต้องการไปเดินเล่นดู ก็ให้เปิด Discord เลี้ยวขวาแล้วไปที่ Server Discovery จากนั้นเลี้ยวซ้ายสองทางผ่านร้านสะดวกซื้อ แล้วคลิกแท็บ Student Hubs ใหม่\n* **เพิ่มการอนุญาตสำหรับกระทู้ใหม่** เพิ่มการอนุญาต *ส่งข้อความในกระทู้* เพื่อปรับปรุงประสบการณ์ของชุมชนและอัปเดต *สร้างกระทู้สาธารณะ*, *สร้างกระทู้ส่วนตัว* และ*จัดการกระทู้* เพื่อให้เข้าใจได้ง่ายขึ้น เรียนรู้เพิ่มเติมใน [คำถามที่พบบ่อยในการดูแลกระทู้](https://support.discord.com/hc/en-us/articles/4404809613847)\n\n\nการอัปเดตการเข้าถึง {progress}\n======================\n\n* **เพิ่มการรองรับแป้นพิมพ์สำหรับการลากและวาง** ตอนนี้คุณสามารถจัดเรียงและจัดระเบียบทุกอย่างรวมถึงคอลเล็กชันเซิร์ฟเวอร์ ช่อง และบทบาททั้งหมดผ่านแป้นพิมพ์ของคุณ\n* ** แถบเลื่อนการแปลงข้อความเป็นคำพูด (TTS) ใหม่** ปรับแต่งความเร็วในการอ่านออกเสียงข้อความให้คุณฟังโดยใช้แถบเลื่อน TTS ใหม่ เรียนรู้เพิ่มเติม[ที่นี่](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab)\n\n\n---changelog---\ndate: "2021-10-04"\nlocale: "tr"\nrevision: 1\nimage: "https://cdn.discordapp.com/attachments/677236002271526936/857671612651143178/7gFzadkQ.png"\n---\nYeni Özellikler {added marginTop} \n====================== \n\n* **Her sunucu için farklı avatarlar yükle. ** Nitro ile istediğin kişi ol ve her sunucuda farklı bir avatar kullan. Sunucuların her biri için benzersiz bir avatar ayarla. Birinde öğrenci, diğerinde D&D karakterin ve üçüncüsünde yalnızca kendin ol, kim olmak istersen... \n* **Seviye 2 ve 3 Takviyesi için gereken Takviyeler düşürüldü. ** Sunucular artık 7 Takviye ile 2. Seviyeye ve 14 Takviye ile 3. Seviyeye ulaşabilir! Sunucun için daha fazla özel emoji, herkes için daha yüksek yükleme yapma imkanı, bir sunucu başlığı, sunucu başlığının ne olması gerektiğine dair argümanlar ve rol simgeleri gibi şeylerin kilidini aç. \n* **Evet, yanlış okumuyorsun, 2. Seviye Yükseltme\'ye özel rol simgeleri eklendi.** 7 Takviyesi olan bir sunucun varsa, bir resim yükle veya her rol için simge olarak ayarlamak üzere özel bir emoji seç. Rol simgeleri, üye listesindeki rol adlarının yanında ve metin sohbeti sırasında kullanıcı adlarının yanında görüntülenecek. Rol simgelerini hemen denemek için Sunucu Ayarları> Roller\'e git ve bir rolü düzenle. \n* **Öğrenci Merkezleri uluslararası olarak kullanıma açılıyor.** Okulun veya üniversiten için kulüpler, çalışma grupları ve daha fazlasına ulaşmak adına öğrenciler tarafından işletilen sunucularla bağlantı kur. Öğrenci Merkezine erişmek için okul e-postanı al ve [başla](https://discord.com/invite/hzA3MtAURu). Veya yürüyüşe çıkmak istiyorsan Discord\'u aç, sağa dön ve Sunucu Keşfi\'ne git. Ardından marketten iki sola dön ve yeni Öğrenci Merkezleri sekmesine tıkla. \n* **Yeni alt başlıklar izinleri eklendi.** Topluluğun deneyimini geliştirmek için *Alt Başlıklarda İleti Gönder* izni eklendi ve daha kolay anlaşılması için *Genel Alt Başlık Oluştur*, *Özel Alt Başlık Oluştur* ve *Alt Başlıkları Yönet* izinleri güncellendi. [Alt Başlık SSS\'mizden](https://support.discord.com/hc/en-us/articles/4404809613847) daha fazla bilgi edinebilirsin. \n\n\nErişilebilirlik Güncellemeleri {progress} \n====================== \n\n* **Sürükle ve bırak için klavye desteği eklendi.** Artık sunucu koleksiyonları, kanallar ve roller dahil her şeyi klavyen aracılığıyla sıralayabilir ve düzenleyebilirsin. \n* **Yeni metin okuma kaydırıcısı.** Yeni metin okuma kaydırıcısını kullanarak mesajların sana ne kadar hızlı okunacağını özelleştir. Daha fazla bilgi edinmek için sayfamızı ziyaret edebilirsin. [buradan](https://support.discord.com/hc/en-us/articles/1500010454681-Accessibility-Settings-Tab).\n\n\n'
